import React, { useState } from "react";
import { Form, Input, useFormik } from "formik";
import axios from "axios";
function Post() {
  const [values, setvalues] = useState([]);
  const url = "http://127.0.0.1:8000/api/person/";
  const formik = useFormik({
    initialValues: {
      name: "",
      lastname: "",
      age: "",
    },
    onSubmit: (values) => {
      axios.post(`${url}`).then((resp) => setvalues(resp.data));
    },
  });
  return (
    <div>
      <Form>
        <Input></Input>
      </Form>
    </div>
  );
}

export default Post;
